import React from "react";
import {
  Navigate,
  Route,
  BrowserRouter as Router,
  Routes,
} from "react-router-dom";
import { Dashboard, ErrorPage, Login, Register } from "./components";
import { Edit, MobileDetails, PostingData } from "./modules/mobiles";
import ProtectedRoute from "./Routes/authRoutes/protectedRoutes";

const RouterComponent = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="login" replace />} />
        <Route path="dashboard" element={<Dashboard />} />
        <Route path="dashboard/:id" element={<ProtectedRoute></ProtectedRoute>} />
        <Route path="uploads" element={<PostingData />} />
        <Route path="edit/:id" element={<ProtectedRoute><Edit /></ProtectedRoute>} />
        <Route path="register" element={<Register />} />
        <Route path="login" element={<Login />} />
        <Route path="*" element={<ErrorPage />} />
      </Routes>
    </Router>
  );
};

export default RouterComponent;
